        `,hypertext:"Check out the code (there's pictures here)",url:"https://github.com/EmilBert/ray-william-tracer",image1:"https://i.imgur.com/xPlJRNW.png",image2:"https://i.imgur.com/Mfi9YGw.png"},{title:"Barker",description:"Typescript, ReactJS, Supertokens, GCP, ChakraUI",firstSection:`
